/*!50003 CREATE*/ /*!50017 DEFINER=`improov`@`10.%`*/ /*!50003 TRIGGER `atualizar_status_imagem` AFTER UPDATE ON `funcao_imagem` FOR EACH ROW BEGIN  
    IF NEW.status = 'Em andamento' AND OLD.status <> 'Em andamento' THEN  
        UPDATE imagens_cliente_obra  
        SET substatus_id = 3  -- Alterado para a coluna correta
        WHERE idimagens_cliente_obra = NEW.imagem_id;  
    END IF;  
    IF NEW.status = 'Em aprovação'AND OLD.status <> 'Em aprovação' THEN 
        UPDATE imagens_cliente_obra  
        SET substatus_id = 4  
        WHERE idimagens_cliente_obra = NEW.imagem_id;  
    END IF;  
END */;;
