/*!50003 CREATE*/ /*!50017 DEFINER=`improov`@`10.%`*/ /*!50003 TRIGGER trg_marcos_pessoais
AFTER UPDATE ON funcao_imagem
FOR EACH ROW
BEGIN
    DECLARE qtd_finalizadas INT;
    DECLARE colaborador_nome VARCHAR(255);
    DECLARE funcao_nome VARCHAR(255);
    DECLARE ultimo_marco INT;

    -- Só dispara se mudou para Finalizado
    IF NEW.status = 'Finalizado' AND OLD.status <> 'Finalizado' THEN

        -- Buscar nome do colaborador
        SELECT COALESCE(nome_colaborador, 'Colaborador')
        INTO colaborador_nome
        FROM colaborador
        WHERE idcolaborador = NEW.colaborador_id
        LIMIT 1;

        -- Buscar nome da função
        SELECT COALESCE(nome_funcao, CONCAT('Função ', NEW.funcao_id))
        INTO funcao_nome
        FROM funcao
        WHERE idfuncao = NEW.funcao_id
        LIMIT 1;

        -- Conta quantas finalizações o colaborador tem nessa função
        SELECT COUNT(*) INTO qtd_finalizadas
        FROM funcao_imagem
        WHERE colaborador_id = NEW.colaborador_id
          AND funcao_id = NEW.funcao_id
          AND status = 'Finalizado';

        -- Último marco registrado
        SELECT COALESCE(MAX(total_finalizacoes), 0)
        INTO ultimo_marco
        FROM marcos_pessoais
        WHERE colaborador_id = NEW.colaborador_id
          AND funcao_id = NEW.funcao_id;

        -- Loop para registrar todos os múltiplos de 50 que ainda não existem
        WHILE ultimo_marco + 50 <= qtd_finalizadas DO
            SET ultimo_marco = ultimo_marco + 50;

            INSERT IGNORE INTO marcos_pessoais (colaborador_id, funcao_id, total_finalizacoes)
            VALUES (NEW.colaborador_id, NEW.funcao_id, ultimo_marco);

            INSERT INTO feed_atualizacoes (tipo_evento, colaborador_id, descricao, data_evento)
            VALUES (
                'marco_pessoal',
                NEW.colaborador_id,
                CONCAT('🎯 ', colaborador_nome, ' atingiu ', ultimo_marco, 
                       ' finalizações na função ', funcao_nome, '.'),
                NOW()
            );
        END WHILE;

    END IF;

END */;;
DELIMITER ;
